import React from "react";
import "../css/baner.css";

const Baner = () => {
  return (
    <div className="baner">
      <div className="rgba">
         <div className="banerh1"><h1>Центар за учење, Кариера и Иновација</h1></div> 
      </div>
    </div>
  );
};

export default Baner;
